import { Table } from "reactstrap";
import {getEventList} from "../lib/utility";
export default ({allEventData}) => {  
  return (
    <div>
      <Table striped>
        <thead>
            <tr>
            <th>Purpose of Event</th>
            <th>Date and Time of Event</th>
            <th>details</th>
            </tr>
        </thead>
        <tbody>
            {
                allEventData.map((res)=>(

                        <tr>
                            <td>res.purpose</td>
                            <td>res.conducted_on</td>
                            <td>res.details</td>
                        </tr>
                ))
            }

        </tbody>
        </Table>
    </div>
  );
};


export async function getStaticProps() {
    const allEventData = JSON.parse(JSON.stringify(getEventList()));
    console.log(typeof(allEventData));
    return {
      props: {
        allEventData
    }
    }
  }
